import ScrollAnim from 'rc-scroll-anim';
import React from 'react';
import ReactDOM from 'react-dom';
import QueueAnim from 'rc-queue-anim';
import TweenOne from 'rc-tween-one';
// import Menu from './components/ui/Menu';

const Link = ScrollAnim.Link;
const Element = ScrollAnim.Element;
const ScrollOverPack = ScrollAnim.OverPack;
const EventListener = ScrollAnim.Event;


class Menu extends React.Component {
  constructor() {
    super();
    this.state = {
      show: false,
    }
    // const classe = this.dom.className;
  }



  render() {


    const count = [
      {id: 1, classe: 'Hello World', to: 'Welcome to learning React!'},
      {id: 2, classe: 'Installation', to: 'You can install React from npm.'}
    ];
    const linkItems = count.map((number) =>
      <Link className={count.classe} to={count.to} showHeightActive={['50%', '10%']}>{number}</Link>
    );

    return (
      <div className="nav-wap">
        <Link className={'nav-list logo'} to={'page0'} showHeightActive={['50%', '10%']}
        ><p>Ale Almeida</p></Link>


        {linkItems}
      </div>
    );
  }
}





export default Menu;
